import React from 'react'
import { Link } from 'react-router-dom'

export default function AnimeCard({ imgSrc }) {
    return (
        <Link>
            <div>
                <img src={imgSrc} className='w-[120px] h-auto'></img>
            </div>
        </Link>
    )
}
